const TableCell = ({ Renderer, cellHoverHandler, isNearest, ...props }) => {
   const [state, setstate] = useState(initialState);
   const style = isNearest ? { backgroundColor: "aqua" } : null;
   return (
      <td style={style} onMouseEnter={cellHoverHandler}>
         <Renderer {...props} />
      </td>
   );
};

export default TableCell;
